export class UserItem {
  id: number;
  firstName: string;
  lastName: string;
  attribute: string;
  email: string;

  constructor(data: any) {
    this.id = data.id;
    this.firstName = data.firstName;
    this.lastName = data.lastName;
    this.attribute = data.attribute;
    this.email = data.email;
  }

  get fullName(): string {
    return `${this.lastName} ${this.firstName}`;
  }
}
